### YamlMime:PythonClass
uid: azure.mgmt.datamigration.models.NonSqlDataMigrationTableResult
name: NonSqlDataMigrationTableResult
fullName: azure.mgmt.datamigration.models.NonSqlDataMigrationTableResult
module: azure.mgmt.datamigration.models
summary: 'Object used to report the data migration results of a table.


  Variables are only populated by the server, and will be ignored when sending a request.'
constructor:
  syntax: 'NonSqlDataMigrationTableResult(**kwargs: Any)'
variables:
- description: 'Result code of the data migration. Known values are: "Initial", "Completed",

    "ObjectNotExistsInSource", "ObjectNotExistsInTarget", "TargetObjectIsInaccessible",
    and

    "FatalError".'
  name: result_code
  types:
  - <xref:str>
  - <xref:azure.mgmt.datamigration.models.DataMigrationResultCode>
- description: Name of the source table.
  name: source_name
  types:
  - <xref:str>
- description: Name of the target table.
  name: target_name
  types:
  - <xref:str>
- description: Number of rows in the source table.
  name: source_row_count
  types:
  - <xref:int>
- description: Number of rows in the target table.
  name: target_row_count
  types:
  - <xref:int>
- description: Time taken to migrate the data.
  name: elapsed_time_in_miliseconds
  types:
  - <xref:float>
- description: List of errors, if any, during migration.
  name: errors
  types:
  - <xref:list>[<xref:azure.mgmt.datamigration.models.DataMigrationError>]
